import React from 'react';
import './MenuItem.css';
import { Card, CardBody, CardImg, CardTitle } from 'reactstrap';

const MenuItem = ({ image, title, link }) => {
  return (
    <br>
      <Card>
        <CardImg variant='top' src={image} />
        <CardBody>
          <CardTitle>{title}</CardTitle>
        </CardBody>
      </Card>
      <br />
    </br>
  );
};

export default MenuItem;
